import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Planner from './Planner'; // Import your Planner component (replace with the actual path)

const App = () => {
  return (
    <div>
      <h1>Your Awesome Planner App</h1>
      <Switch>
        <Route exact path="/">
          {/* The home route, maybe a dashboard or something */}
          <Planner />
        </Route>
        {/* Add more routes as needed */}
      </Switch>
    </div>
  );
};

export default App;
